@-moz-document url("http://www.youtube.com/"), url-prefix("http://www.youtube.com/"), domain("youtube.com"), regexp("https:.*") {
  .exp-invert-logo #header:before, .exp-invert-logo .ypc-join-family-header .logo, .exp-invert-logo #footer-logo .footer-logo-icon, .exp-invert-logo #yt-masthead #logo-container .logo, .exp-invert-logo #masthead #logo-container, .exp-invert-logo .admin-masthead-logo a, .exp-invert-logo #yt-sidebar-styleguide-logo #logo {

      background: no-repeat url(https://s.ytimg.com/yts/imgbin/www-hitchhiker-vfl-Nn88d.png) -179px -227px;
      width: 71px;
      height: 30px;

  }

.exp-responsive #yt-masthead .yt-masthead-logo-container {
    
    width: 130px;
    
}



  @media only screen and (max-width: 498px) and (min-width: 0px), only screen and (max-width: 704px) and (min-width: 499px) {
      .exp-invert-logo.exp-responsive #yt-masthead #logo-container {

          background: no-repeat url(https://s.ytimg.com/yts/imgbin/www-hitchhiker-vfl-Nn88d.png) -247px -152px;
          width: 40px;
          height: 28px;

      }
		.exp-responsive #yt-masthead .yt-masthead-logo-container {
    
    	width: auto;
     
     }
  }
}
